import React from 'react'
import Manifest from './manifest.json'
import Image from './image.jpeg'

const CTA = () => {
    return (
        <div className='flex space-x-5'>
            <button className='select-none text-center max-w-max text-black text-base font-bold p-3 rounded-full px-5 bg-white active:opacity-0 transform transition hover:scale-110 duration-300 ease-in-out'>Join presale</button>
            <button className='select-none text-center max-w-max text-black text-base font-bold p-3 rounded-full px-5 bg-white bg-opacity-20 active:bg-black text-white transform transition hover:scale-110 duration-300 ease-in-out'>Watch live</button>
        </div>
    )
}
const LandingContent = () => {
    return (
    <div className='grid grid-flow-row justify-items-center place-content-center bg-black text-white h-screen'>
        <div className='font-extrabold text-4xl'>{Manifest.motto}</div>
        <img src={Image} alt='boxing' className='filter contrast-125 brightness-110'/>
    </div>
    )
}

export default LandingContent

